import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question(props) {

    const q = id => {
        return props.getquestionid(props.id);
    }

    return(
        <Paper>
            <h1>Question Details</h1>
        </Paper>
    )
}

export default Question;
